function deleteFiles(obj) {
	var now = new Date();
	var day = now.getDate();
	var month = now.getMonth();
	var year = now.getFullYear();

	var month1 = new Date(year, month-1, day);
	var month6 = new Date(year, month-6, day);
	var month12 = new Date(year-1, month, day);

	var month1Unix = Math.floor(month1.getTime()/1000);
	var month6Unix = Math.floor(month6.getTime()/1000);
	var month12Unix = Math.floor(month12.getTime()/1000);

	var cameras = {};
	var toDelete = [];

	Object.keys(obj.data).forEach(function (key) {
		var packet = {
			filename: obj.data[key][0].replace(".JPG", ""),
			ass_vid: obj.data[key][1],
			cam: obj.data[key][2],
			del: obj.data[key][3],
			arc: obj.data[key][4],
			fav: obj.data[key][5],
			dt: obj.data[key][6]
		};

		if (cameras[packet.cam] === undefined) {
			cameras[packet.cam] = 1;
		} else {
			cameras[packet.cam]++;
		}

		if ((cameras[packet.cam] > 200) ||
			(packet.del === "1") ||
			(packet.dt < month12Unix) ||
			(packet.dt < month6Unix && packet.arc !== "1") ||
			(packet.dt < month1Unix && packet.arc !== "1" && packet.fav !== "1")
		   ) {
			var file = packet.cam+"/"+packet.filename+".JPG";
			var thumb = packet.cam+"/"+packet.filename+"-thumb.JPG";
			var preview = packet.cam+"/"+packet.filename+"-preview.JPG";
			toDelete.push(file);
			toDelete.push(thumb);
			toDelete.push(preview);
			//console.log(file, thumb, preview);
			if (packet.ass_vid !== "") {
				var ass_vid = packet.cam+"/"+packet.ass_vid;
				toDelete.push(ass_vid);
			}
		}
	});
	return toDelete;
}

